    "2016-11-25T21:06:16.109289",nt"name": "frss-106-school-safety-and-discipline-201314",nt"isopen":
    true,nt"url": null,nt"notes": "School Safety and Discipline, 2013-14 (FRSS
    106), is a study that is part of the Fast Response Survey System (FRSS) program;
    program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
    FRSS 106 (http://nces.ed.gov/surveys/frss/index.asp) is a study that provides nationally
    representative data on safety and discipline in public schools. The study was conducted
    using mailed questionnaires that could be completed on paper or online. Public schools
    in each level (elementary, middle, high school, and combined) were sampled. The
    study's weighted response rate was 85%. Key statistics produced from FRSS 106 will
    provide information on specific safety and discipline plans and practices; training
    for teachers and aides related to school safety and discipline issues; use of law
    enforcement or security personnel on school grounds; frequency of specific discipline
    problems; and the number of incidents of various crimes that occurred during the
    2013-14 school year.",nt"license_title": "Creative Commons CCZero",nt"extras":
